export default (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},COiNkePgrT:{data:{id:2597,attributes:{imdbId:"tt0073802",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjQ1MmI4ODYtMTQwYi00OWM3LWFkOTQtZGJmMjViNTI4MDBiXkEyXkFqcGdeQXVyMjUzOTY1NTc@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"7.4\u002F10"},{Source:"Rotten Tomatoes",Value:"88%"},{Source:"Metacritic",Value:"63\u002F100"}],item_lang:{data:{id:3260,attributes:{title:"Three Days of the Condor",plot:"A mild mannered CIA researcher, paid to read books, returns from lunch to find all of his co-workers assassinated. \"Condor\" must find out who did this and get in from the cold before the hitmen get him.",slug:"three-days-of-the-condor"}}},books:{data:[{id:1604,attributes:{title:g,description:"The classic spy thriller about corruption in the CIA that inspired the hit film and TV show: “A master of intrigue” (John Grisham). Sandwiches are a part of Ronald Malcolm’s every day, but one just saved his life. On the day that gunmen pay a visit to the American Literary Historical Society, he’s out at lunch. The society is actually a backwater of the Central Intelligence Agency, where Malcolm and a few other bookworms comb mystery novels for clues that might unlock real life diplomatic questions. One of his colleagues has learned something he wasn’t meant to know. A sinister conspiracy has penetrated the CIA, and the gunmen are its representatives. They massacre the office, and only learn later of Malcolm—a loose end that needs to be dealt with. Malcolm—codename Condor—calls his handlers at the agency, hoping for a safe haven, instead drawing another attempt on his life. With no one left to trust he goes on the run. But like it or not, Malcolm is the only person who can root out the corruption at the highest levels of the CIA. This “chilling novel of top security gone berserk” earned James Grady his reputation as a Grand Master of the spy thriller, inspiring legions of imitators as well as the classic Sydney Pollack film Three Days of the Condor and the new TV series Condor featuring Max Irons, Mira Sorvino, and Brendan Fraser (Library Journal).",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=jYk6XwKxIaUC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:h,publisher:"Open Road Media",subtitle:i}},{id:1605,attributes:{title:j,description:k,thumbnail:l,authors:[a],firstBook:c,published:m,publisher:d,subtitle:n}},{id:1606,attributes:{title:g,description:"The novel that inspired the Robert Redford film Three Days of the Condor Sandwiches save Ronald Malcolm’s life. On the day that gunmen pay a visit to the American Literary Historical Society, he’s out at lunch. The Society is actually a backwater of the Central Intelligence Agency, where Malcolm and a few other bookworms comb mystery novels for clues that might unlock real life diplomatic questions. One of his colleagues has learned something he wasn’t meant to know. A sinister conspiracy has penetrated the CIA, and the gunmen are its representatives. They massacre the office, and only learn later of Malcolm—a loose end that needs to be dealt with. Malcolm—codename Condor—calls his handlers at the Agency, hoping for a safe haven, instead drawing another attempt on his life. With no one left to trust he goes on the run. But like it or not, Malcolm is the only person who can root out the corruption at the highest levels of the CIA.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=VaPQBQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:h,publisher:"Overamstel Uitgevers",subtitle:i}},{id:1607,attributes:{title:"Next Day of the Condor",description:"The explosive short story launch for the new novel LAST DAYS OF THE CONDOR \"They led him out of the CIA's secret insane asylum as the sun set over autumn's forest there in Maine.\" Led him into a modern American nightmare any of us could face. But he's a legend, a silver-haired man codenamed Condor, a classic American hero in his first appearance since Watergate, on his way in this prequel to the upcoming novel, LAST DAYS OF THE CONDOR. And it's all about the price he's forced to pay to get there. Award-winning short story author, screenwriter and novelist James Grady delivers a bullet-paced, savage journey with the iconic character he created and that Robert Redford made an international sensation in the movie THREE DAYS OF THE CONDOR. Love, sex, loyalty, honor and savagery loosed in our modern world electrify this novella, a portrait of heroism and horror and America beyond 9\u002F11. It is an espionage adventure unlike anything you've ever read. \"Grady is to spy novels as the great Elmore Leonard was to crime fiction,\" says Pulitzer Prize winning author Kai Bird, while John Grisham calls Grady: \"A master of intrigue.\" At the Publisher's request, this title is being sold without Digital Rights Management Software (DRM) applied.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=4EvABQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2015-02-01",publisher:d,subtitle:"An E-Book Original Story"}},{id:1608,attributes:{title:j,description:k,thumbnail:l,authors:[a],firstBook:c,published:m,publisher:d,subtitle:n}}]}}},meta:{}}},prerenderedAt:1681309119389}}("James Grady","movie",null,"Forge Books","series",1,"Six Days of the Condor","2011-11-22","","Last Days of the Condor","Now on television: Condor, an AT&T Audience Network original series inspired by James Grady's first Condor novel. Look in the mirror: You're nobody anybody knows. You know pursuing the truth will get you killed. But you refuse to just fade away. So you're designated an enemy of the largest secret national security apparatus in America's history. Good guys or bad guys, it doesn't matter: All assassins' guns are aimed at you. And you run for your life branded with the code name you made iconic: Condor. Everyone you care about is pulled into the gunsights. The CIA star young enough to be your daughter-she might shoot you or save you. The savvy political aide who lets love trump the law. The lonely woman your romantic dreams make a fugitive. The Middle Eastern child warrior you mentored into a master spy. Last Days of the Condor is the bullet-paced, ticking clock saga of America on the edge of our most startling spy world revolution since 9\u002F11. Set in the savage streets and Kafkaesque corridors of Washington, DC, shot through with sex and suspense, with secret agent tradecraft and full-speed action, with hunters and the hunted, Last Days of the Condor is a breakneck saga of America's secrets from muckraking investigative reporter and author James Grady. At the Publisher's request, this title is being sold without Digital Rights Management Software (DRM) applied.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=y_dMBAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2015-02-17","A Novel"))